    const [author, setAuthor] = useState('Yo jimbo');
  return (   
    <div className="container">
        <div className='quote-box'>
            <p>
                "{quote}"
            </p>
            <p>
                - {author}
            </p>
            <button onClick={()=>{
                setQuote();
                setAuthor()}}>Change Quote</button>
        </div>
    </div>
  );
}

export default App;
